import { StyleSheet } from "react-native"

const styles = StyleSheet.create({
    container_informacoes:{
        height: "100%",
        width: "95%"
    },

    container_inf:{
        marginTop: "5%",
        height: 60,
        backgroundColor: "#323232",
        borderRadius: 8,
        flexDirection: "row"
    },

    inf_titulo:{
        marginLeft: 5,
        height: "100%",
        width: "7550%",
        justifyContent: "center"
    },

    inf_valor:{
        height: "100%",
        width: "30%",
        justifyContent: "center"
    },

    titulo:{
        fontSize: 20,
        fontWeight: "bold",
        color: "#0CBECE"
    },

    valor:{
        fontSize: 20,
        fontWeight: "bold",
    },
})
export default styles
